    "COMMENTS": "Eur-Pac is disputing the contents of the record attachment. The attachment does not disclose the full events and activities. On December 30 2018, a notice of lapse and potential contract cancelation due to supplies not being delivered by December 29, 2017. Eur-Pac is disputing this notice for the following reasons. Modification was issued October 20,2017 extending the delivery date to December 29, 2017. On the December 4, 2017 work load report managed by Jim Vizvary, Eur-Pac stated upon inspection dimensional errors were discovered and parts were to be returned to the supplier. Considerable communications occurred with the supplier to take ownership of the error. At issue is a discrepancy of a thread dimension. The geometry indicates the thread is correct,however utilizing a thread gage indicates the thread is out of tolerance. The thread gage has been sent out for calibration to insure its correctness. The supplier has agreed if the gage results shows the thread to be out of tolerance, it will be corrected. The expected completion of this is January 22nd. If parts are approved, a new WAWF submission will occur the week of January 29th.\n\nEur-Pac has acted in good faith to deliver on this contract and the above activities show proper and dedicated communications were made related to the efforts of contract delivery. Once Eur-Pac approves the rework performed by the supplier, we will work with the Contract Office to confirm the new contract delivery date. UPDATE: the items were returned on time, inspected to be correct, and were ready to be submitted for GOVT approval when the contract was cancelled."
