    "EMAIL": "dana@sungroproducts.com",
    "PHONE": "213-747-4125",
    "COMMENTS": "Sungro engaged a new supplier to provide product to SIAD Herlong, CA. Through our oversight, our contracted price did not include freight; this omission wasnâ€™t visible until preparing to ship the first order. Our delay in shipping against the initial purchase order was panic based when we realized the freight cost was more than the purchase order. We notified the Contract Specialist of the pricing error and provided freight costs for the contract duration. However, the Contract Specialist would not approve the additional costs. We then offered to remedy the original purchase order and continue to provide product for the contract duration regardless of the financial hardship to our firm. Our proposed remedy was not acceptable to the Contract Specialist who subsequently issued a Termination for Cause. Because of our oversight, Sungro has implemented additional reviews prior to submitting a proposal or signing a contract. We are confident these additional reviews will prevent a recurrence of pricing oversights."
