    "USER": "Steven Wendt",
    "EMAIL": "steven.wendt@olympus.com",
    "PHONE": "484-896-5436",
    "COMMENTS": "Olympus has investigated this contract and has no record of having received a copy of W81K00-15-P-0796 until receiving this notification through the PPIRS system. There is some confusing info on the document as well.  The government has the item as a \"Bronchoscope\" in CLIN 001 - however the serial number of the instrument listed on the contract, s/n 15048450 is linked to a ureteroscope from the Urology Clinic at this end user location.  We were able to find a record in our repair system related to this scope dated April 14, 2015 but the records indicate that the scope was returned unrepaired to the customer per their request.\n\n \n\n\tHaving reviewed the situation with our service department they believe that perhaps this agreement was created for a scope repair but based on the amount of the estimate the customer asked for the product to be returned unrepaired.  Whatever the case, we have no record of having received this contract from the end using agency. Copies of our service estimate and final disposition are available upon request (I see no way to attachment them in this portal)."
