    "USER": "Tabatha Williams",
    "EMAIL": "tbwilliams@tycoint.com",
    "PHONE": "704-291-8323",
    "COMMENTS": "Scott Safety purchased ISG camera manufacturer. Part numbers were mistakenly transferred into our system which we quoted and sold. After entering the order it was determined that one of the items were no longer available. According to ISG this information had previously alerted the NAVY that this part was not procurable (prior to Scott Safetys involvement with ISG). Rather than removing the one item that was no longer available the entire contract was cancelled. Scott Safety offered to sell a new K90 camera which would have been less than the cost of the components to fix an existing camera. Please see email below to Bryan Manoff and David Kulowitch: \n\nI noticed that one email stated that none of the parts are obtainable but that is not the case. Some parts still are available, however, I understand that without the Secca/Detector the other items may not be needed. Of the items originally requested the ones listed below are still available at this time:\n\n8003015           Pyrometer Teflon Ring\n\n8003016           Main Lens Teflon Ring\n\n8003017           Pyro Ring/Gasket\n\n8003023           Pyro Bracket\n\n8003162           Front Lens Gasket\n\nThe 8003120 is no longer offered as this is now obsolete technology. The Navy was apprised of this change in 2009. \n\nA new K90 camera is listed currently on GSA for $6745.84. This price includes a neckstrap, detachable pistol grip, two NiMH batteries, battery charger, charger a/c power supply, back up AA battery adapter and operators manual housed in a waterproof case.\n\nThe cost of a new camera is significantly less than what the cost would be on replacement parts.\n\nIf you would like a formal quote on the K90 camera currently listed on GSA please let me know and I will be happy to provide a quote. I proposed this option at the time that we realized that we no longer had any of the 8003120 in stock."
