    "USER": "Patrick Blair",
    "EMAIL": "pblair@ccrscrap.com",
    "PHONE": 7207882541,
    "COMMENTS": "NAVFAC Southwest has awarded Cherry Creek Recycling 4 contracts under this DEMO MACC. Of those 4 contracts CCR elected not to pursue the last contract given the state of the first three. One was delayed 6 months beyond the POP, had asbestos changes that were not paid for and CCR received no compensation other than time for those changes. The second has differing site conditions and asbestos changes, all of which the base has denied, refusing to compensate CCR for the changes, and the 3rd has a 270 day performance period without an approved baseline schedule now 255 days into the contract.  No work has commenced, and the entire NAVFAC team for the project is outside its contractual requirements of 21 day review periods. CCR can no longer carry the federal govt and hope to be reimbursed for delays and changes. It has chosen not to provide Bonds or Baseline schedules and walk away from the above contract rather than continue to incur debt that does not get reimbursed.The answer received from one KO on a project with changes and delays was to go get a bank loan to cover the federal government not paying its bills.\n\nCCR does not wish to continue working for this owner beyond its current obligations."
