    "COMMENTS": "Good morning,\n\nWe have 6 contracts that were termintaed for cause that were all on the same teaming agreement with a company called shields llc A veteran owned business. They were losing 6 contracts due to they were not women owned so we bid with them on a teaming agreement. When we found out we were being taken advantage of we questioned them and they left contract. The contracting officers jana Knapp and a few others refused to give us any information on contracts as well as other contracting officers on the 6 contracts. Cheryl bremby stepped in and told contracting officers even though it was a teaming agreement it was our contract and they needed to give us the information. By the time we got information our subcontractors had left project. some call it discrimination we are calling it a bad teaming agreement.  How do we dispute cause for determination."
