    "USER": "Veronica Williams",
    "EMAIL": "Diversityagreementspcs@gmail.com",
    "PHONE": 2178363070,
    "COMMENTS": "Contract, solicitation and supporting documents for item W912JV-17-P-2077 failed to include all required services necessary for bid by the requesting office. Specifically, the requirements for media services hosting in the mall space. The solicitation and resulting contract displayed identical, overlapping services for the Awardee, DAPCS, and the Mall advertising agency GGP, Inc., Inc., with a cause for transition without cause or determination. Requests for clarification were made by the Awardee, DAPCS, to avoid work at risk for the Awardees subcontractor, Ace Sign Co. Additionally, it was acknowledged both by GGP, Inc., and the service requesting office, post award that a predetermined cost and the undisclosed services had been discussed in house and shared with the other candidates bidding on this opportunity without, DAPCSs knowledge prior to award, the cost of which well exceeded the entire budget per award. DAPCS provided a well itemized and specified agreement budget for the services requested per solicitation requirements, which was reviewed and approved by the contracting office prior to award, this provided specific transparency of intent, ability and capacity per award. Finally, it was disclosed post award by GGP, Inc. that the previous implementation of this contract in past years was facilitated as what was described as a minority contract award pass through, in which all awarded funding turned over to GGP, Inc. for the processing of the requested services. I stated to both entities that DAPCS could not operate under those terms per requirements for transparency reporting for minority services and obligation to our subcontractor per agreement, Ace Sign co, who provided specific and itemized graphics quotes. Many attempts for resolution were made. DAPCS continued to provide services at risk until such time that the contracting office refused to provide specific answers to clarify the terms of the agreement and services, terminating the agreement."
