    "COMMENTS": "The contract was for a hose assembly and we quoted the exact item manufactured by Contitech. Between the time the item was quoted and awarded, Contitech suspended production of this hose. This was due to a restructuring after a Contitech bought Veyance Technologies. \n\n\n\nEvery effort was made to deliver the item, we scoured Continental Distributors for any leftover stock but there was none available. We also offered alternatives.\n\n\n\nWe were fully transparent and informed the contracting office as soon as we were told about Contitech suspending production on the hose. The manufacturerâ€™s decision to suspend production on this hose was outside of our control, but we offered several alternatives. We did not agree with the contracting officerâ€™s decision to terminate for cause and we dispute the FAPIIS record."
