    "USER": "Bill Bailey",
    "EMAIL": "bill.bailey@musicministryintl.com",
    "PHONE": 6198040475,
    "COMMENTS": "This is a firm fixed price contract based on part-time hours under the performance work statement.  The companys two active sub-contractors resigned prior to contract completion reporting a discrepancy between the hours demanded by military staff and the hours contained in the PWS.  The initial sub-contractor negotiated with the onsite military supervisor for flex time which provided and equitable adjustment aligning with the PWS and also allowed for the contract deliverables to be achieved.  After the PSC of the onsite military supervisor, the contractor resigned reporting to the company a significant shift in the chapel culture toward an increasingly hostile workplace and increasing impediments to achieving the deliverables which were being caused by military staff.  The second sub-contractor worked only a few months reporting similar conditions in the workplace environment and the hourly demands of the military staff.  \n\n\n\n     The company made several attempts to provide additional qualified sub-contractors who also reported similar limited experience with the workplace environment and culture.  After receiving this feedback, the company brought these issues to the attention of the contracting office together with a willingness to negotiate remedies.  No remedies of any kind were ever discussed."
