    "PHONE": "775-276-1086",
    "COMMENTS": "My now defunct company, Akenaten Bluehorse  (sole proprietor) won this $40,000 laundry contract. In 8 months we only had $1,200 in work. The KO changed the contract definition of shirt to cover an ACU jacket  (see https://www.army.mil/e2/rv5_downloads/symbols/ACU_Factsheet.pdf). We complained. The KO retaliated by terminating the contract on 3 basis (failure to submit her records to assure compliance with the Service Contract Act, Limitations on Subcontracting, and corrective actions for our employee)\n\n\n\nEach ground is illegal because:\n\n1) Limitations on subcontracting has no applicability to simplified acquisitions, like this.  FAR Part 19.508 (e)  provides that is applicable to contracts that exceed $150,000. Also See Â§Â¿125.6(j) of the Small Business act.\n\n\n\n2) the Service Contract Act has no applicability to my teaming partner (and my company) who have just 2 employees. This is because contracts with five or less employees contemplated to be employed are exempt from the provisions of the SCA under the regulations, the DOL is only obligated to issue a wage determination for those contracts under which more than five service employees are to be employed. See 41 U.S.C. Â§ 6707(f); 29 C.F.R. Â§Â§ 4.3-4.4.\n\n\n\nFurther, the DOL WHD is the enforcer of the Service Contract Act, not the KO.\n\nGAO-06-27 Service Contract Act http://www.gao.gov/new.items/d0627.pdf,  page 19\n\n\n\n3) Audits are not allowed under simplified acquisitions, like this.\n\nFar Part  13.005 â€“ List of Laws Inapplicable to Contracts and Subcontracts at or Below the Simplified Acquisition Threshold.   See subsection (a)(7) 10 U.S.C. 2313 and 41 U.S.C. 4706 (Authority to Examine Books and Records of Contractors).   \n\n\n\n4) KO is contravened the contractor status of the relationship between the agency and my company by demanding corrective actions in this non-personal services contract. ( Note: the opposite  type of contract, Personal Services Contract Per FAR 37.104 is one in which an employer-employee."
