    "EMAIL": "tatiana@graulingresearch.com",
    "PHONE": 7076879577,
    "COMMENTS": "This contract was awarded based on Grauling Research Inc. (Grauling) as a Small Business Set-aside. We subcontracted with another small business to produce the material requested. Unbeknownst to Grauling the subcontractorâ€™s parent company disqualified them as a small business even though in the proposal stage our subcontractor reviewed and agreed to (FAR) 52.219- contract terms and conditions.  After Grauling was awarded the contract we received a stop work from the US Army due to compliance issue regarding FAR Clause 52.219-6(d). Grauling respectfully complied with all requests to provide documentation during the proposal & contract phase and requested a waiver based on Title 15 USC Section 657s (4) (a). Our waiver was based on facts that we met all requirements for competitive price point, met all material specifications with no exception and U.S. manufacturing requirements.  After 3 months, on December 4, 2019 the US Army delivered the formal withdrawal of contract, denying our request for the waiver described above.  As a certified SDVOSB we take immense pride in all of the contracts we have successfully completed with the federal government and have taken this particular experience into mind as we continue to provide proposals to the U.S. government moving forward."
