    "PHONE": 7034018468,
    "COMMENTS": "After a few days, MICC-Fort Braggâ€™s end-user determined that the hotel was not adequate for its needs and Ms. Clements submitted a request to Mr. Hanson to provide lodging at a different hotel. EMGâ€™s standard operating procedure when an account manager or sales representative receives such a request is for the account manager or sales representative to escalate the request to both an\n\nexecutive officer of EMG. This allows EMG to assure that the request is processed promptly and that the needs and concerns of the contracting agency are fully addressed at a senior level within EMG. Despite having been aware of and trained to implement this procedure, Mr. Hanson did not escalate the request to an executive officer of EMG and EMGâ€™s Sales Director. In fact, Mr. Hanson did not inform anyone at EMG about this request. Unbeknown to EMG, at the time that he was handling the account for MICC- Fort Bragg, Mr. Hanson appears to have been actively preparing to leave EMG and to directly compete with EMG in the lodging and transportation fields.\n\nAs a result of EMGâ€™s failure to respond to the request to change hotels, it appears that\n\nMs. Clements terminated the Purchase Order and reported said termination as a termination for\n\ncause in the FAPIIS database. Mr. Hanson did not inform any of his supervisors at EMG that\n\nMICC-Fort Bragg had terminated the Purchase Order, and EMG was not aware that Ms.\n\nClements had filed a negative rating in the FAPIIS database. \n\nBased on his conduct as alleged in the lawsuit filed by EMG, EMG believes that Mr.\n\nHansonâ€™s actions with respect to the Purchase Order were deliberate and motivated by his plans\n\nto directly compete with EMG. We respectfully request that MICC-Fort Bragg removes or rescind its report in the FAPIIS database that the Purchase Order was terminated for cause. EMG has never had a negative report in the FAPIIS database, this rating significantly harms its prospects of being awarded future contracts."
