    "COMMENTS": "It should be noted that Magnificus did everything in its power to work with the COR and the Medical Group on this placement, but our efforts were particularly stalled by the COR, who ultimately recommended to the Contracting Officer to issue a termination for cause on the Task Order.\n\n\n\nEven though the COR seldom acknowledge any Government oversight, it is important to note that the COR inadvertently posted two FAPPIS notices for the same task order, even though, there should only be one for the task order. Was the intent to show that Magnificus has more terminations for cause or just an honest mistake that needs to be corrected?"
